import React from 'react';
import {NavLink} from 'react-router-dom';

const Menu =()=>{
    return(
        <>
            <ul>
                <NavLink activeClassName="active" to='/'><li>Home</li></NavLink>
                <NavLink activeClassName="active" to='/a'><li>URL A</li></NavLink>
                <NavLink activeClassName="active" to='/b'><li>URL B</li></NavLink>
            </ul>
        </>
    );
};
export default Menu;
